import React, { Component, useContext } from "react";
import axios from "axios";
import { observer } from "mobx-react-lite";
import { birthContext } from "../context/birth";
import Link from "next/link";
const linkStyle = {
  marginRight: "1rem",
};
const topnavbar = observer(({ req }) => {
  const birthInfo = useContext(birthContext);
  return (
    <div>
      <button type="button" class="btn btn-primary">
        Primary
      </button>
      {birthInfo.birth_total}
      <Link href="/">
        <a style={linkStyle}>홈</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>소개</a>
      </Link>
    </div>
  );
});

/*topnavbar.getInitialProps = async ({ req }) => {
  return req
    ? { from: "server" } // 서버에서 실행 할 시
    : { from: "client " }; // 클라이언트에서 실행 할 시
};*/

export default topnavbar;
